import React from "react";
import {Menu} from "antd";
import {Link} from "react-router-dom";

import CustomScrollbars from "util/CustomScrollbars";
import SidebarLogo from "./SidebarLogo";
import UserProfile from "./UserProfile";
import AppsNavigation from "./AppsNavigation";
import {
  NAV_STYLE_NO_HEADER_EXPANDED_SIDEBAR,
  NAV_STYLE_NO_HEADER_MINI_SIDEBAR,
  THEME_TYPE_LITE
} from "../../constants/ThemeSetting";
import IntlMessages from "../../util/IntlMessages";
import {useSelector} from "react-redux";

const SubMenu = Menu.SubMenu;
const MenuItemGroup = Menu.ItemGroup;


const SidebarContent = ({sidebarCollapsed, setSidebarCollapsed}) => {
  const {navStyle, themeType} = useSelector(({settings}) => settings);
  const pathname = useSelector(({common}) => common.pathname);

  const getNoHeaderClass = (navStyle) => {
    if (navStyle === NAV_STYLE_NO_HEADER_MINI_SIDEBAR || navStyle === NAV_STYLE_NO_HEADER_EXPANDED_SIDEBAR) {
      return "gx-no-header-notifications";
    }
    return "";
  };
  const getNavStyleSubMenuClass = (navStyle) => {
    if (navStyle === NAV_STYLE_NO_HEADER_MINI_SIDEBAR) {
      return "gx-no-header-submenu-popup";
    }
    return "";
  };

  const selectedKeys = pathname.substr(1);
  const defaultOpenKeys = selectedKeys.split('/')[1];

  return (
    <>
      <SidebarLogo sidebarCollapsed={sidebarCollapsed} setSidebarCollapsed={setSidebarCollapsed}/>
      <div className="gx-sidebar-content">
        <div className={`gx-sidebar-notifications ${getNoHeaderClass(navStyle)}`}>
          <UserProfile/>
          <AppsNavigation/>
        </div>
        <CustomScrollbars className="gx-layout-sider-scrollbar">
          <Menu
            defaultOpenKeys={[defaultOpenKeys]}
            selectedKeys={[selectedKeys]}
            theme={themeType === THEME_TYPE_LITE ? 'lite' : 'dark'}
            mode="inline">

            <MenuItemGroup key="main" className="gx-menu-group" title={<IntlMessages id="sidebar.main"/>}>
              <SubMenu key="dashboard" popupClassName={getNavStyleSubMenuClass(navStyle)}
                       title={<span> <i className="icon icon-dasbhoard"/>
                         <span><IntlMessages id="sidebar.dashboard"/></span></span>}>
                <Menu.Item key="main/dashboard/home">
                  <Link to="/main/dashboard/home">
                    <i className="icon icon-home"/>
                    <span><IntlMessages id="aid.home"/></span>
                  </Link>
                </Menu.Item>                
              </SubMenu>

            </MenuItemGroup>

            <MenuItemGroup key="in-built-apps" className="gx-menu-group" title={<IntlMessages id="aid.activity"/>}>
              <Menu.Item key="lists/claims">
                <Link to="/lists/claims"><i className="icon icon-check-square-o"/><span><IntlMessages
                  id="aid.claims"/></span></Link>
              </Menu.Item>

              <Menu.Item key="lists/policyholders">
                <Link to="/lists/policyholders"><i
                  className="icon icon-avatar"/><span><IntlMessages
                  id="aid.policyholders"/></span></Link>
              </Menu.Item>

              <Menu.Item key="lists/doctors">
                <Link to="/lists/doctors"><i className="icon icon-contacts"/><span><IntlMessages
                  id="aid.doctors"/></span></Link>
              </Menu.Item>

              <Menu.Item key="lists/coding">
                <Link to="/lists/coding"><i
                  className="icon icon-chat-bubble -flex-column-reverse"/><span><IntlMessages
                  id="aid.coding"/></span></Link>
              </Menu.Item>
            </MenuItemGroup>

            <MenuItemGroup key="social-apps" className="gx-menu-group" title={<IntlMessages id="aid.admin"/>}>
            <Menu.Item key="lists/products">
                <Link to="/lists/products">
                  <i className="icon icon-folder -flex-column-reverse"/>
                  <span><IntlMessages id="aid.products"/></span>
                </Link>
              </Menu.Item>
              <Menu.Item key="lists/users">
                <Link to="/lists/users">
                  <i className="icon icon-profile2"/>
                  <span><IntlMessages id="aid.users"/></span>
                </Link>
              </Menu.Item>

            </MenuItemGroup>           

          </Menu>
        </CustomScrollbars>
      </div>
    </>
  );
};

export default React.memo(SidebarContent);
